import React from 'react';
import indexButton from '../../assets/index2svg-01.svg';
import ToolTip from '../layout/ToolTip';

function IndexButton(){
  const [isShown, setIsShown] = useState(false);

  return (
    <React.Fragment>
        <div className="IndexButton-Component">
          <img className="index-button" src={indexButton} onClick={toggleIndexSidePanel} onMouseEnter={() => setIsShown(true)} alt="index"/>

          {isShown && (
            <ToolTip/>
          )}

        </div>
    </React.Fragment>
  )
}

type MyProps = {
  toggleIndexSidePanel: () => any;
  displayToolTip: () => any;
};

type Props = MyProps;

export default IndexButton;
